namespace SteamBanCheck
{
    class Program
    {
        static void Main(string[] args)
        {
            if (args.Length == 0)
            {
                Console.WriteLine("Please provide a Steam64ID as an argument.");
                return;
            }

            ulong steam64ID = ulong.Parse(args[0]);
            string url = $"https://steamcommunity.com/profiles/{steam64ID}";

            using (WebClient webClient = new WebClient())
            {
                string html = webClient.DownloadString(url);

                Match match = Regex.Match(html, "<td class=\"vacBanned\">VAC Banned:</td><td class=\"value\">(.+?)</td>");
                if (match.Success)
                {
                    Console.WriteLine("VAC Bans: " + match.Groups[1].Value);
                }
                else
                {
                    Console.WriteLine("No VAC bans found.");
                }

                match = Regex.Match(html, "<td class=\"vacBannedDate\">Last VAC Ban:</td><td class=\"value\">(.+?)</td>");
                if (match.Success)
                {
                    Console.WriteLine("Last VAC Ban Date: " + match.Groups[1].Value);
                }
                else
                {
                    Console.WriteLine("No last VAC ban date found.");
                }
            }
        }
    }
}
